import React from "react"
import Item from './component/Item';
function Soucial(){
    return(
   <ul className="list-group">
    <Item />
    <li className="list-group-item">
        <input type="checkbox" id="facbook"/>
        <label for="facbook">facbook</label>
    </li>
    <li className="list-group-item">
        <input type="checkbox" id="instgram"/>
        <label for="instgram">instgram</label>
    </li>
    <li className="list-group-item">
        <input type="checkbox" id="linkden"/>
        <label for="linkden">linkden</label>
    </li>
   </ul>
    );
}
export default Soucial;
